<div class="Parallax GParallax1"><div class="Img Binary"><div class="Caption"><a href="#"><div class="Text">Gestion de base de données avec MySQL<br></div></a></div></div><div class="Body2 Orange"><br>Le but de ce tutoriel est de vous apprendre la gestion de base de données avec <b>MySQL</b>.<br>Produit par <b>Gérard KESSE</b>.<br><br><div class="Content0 GSummary1"><div class="Row26">Summary 1</div></div><br></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Introduction"><a class="Link3" href="#">Introduction</a></h1><div class="Body3"><br><b>MySQL </b>est un système de gestion de bases de données relationnelles (SGBDR). Il est distribué sous une double licence GPL et propriétaire. Il fait partie des logiciels de gestion de base de données les plus utilisés au monde, autant par le grand public (applications web principalement) que par des professionnels, en concurrence avec Oracle, PostgreSQL et Microsoft SQL Server.<br><br><div class="Img3 GImage"><img id="img_1646255196662" alt="img_1646255196662" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Telecharger-le-serveur-MySQL-sous-Windows"><a class="Link3" href="#">Télécharger le serveur MySQL sous Windows</a></h1><div class="Body3"><br>Télécharger le serveur MySQL sous Windows.<br><br><div class="Content0 GSummary2"><div class="Row26">Summary 2</div></div><br><h2 class="Title7 GTitle2" id="Telecharger-le-serveur-MySQL-sous-Windows-Acceder-au-lien-principal"><a class="Link9" href="#Telecharger-le-serveur-MySQL-sous-Windows">Accéder au lien principal</a></h2><br><div class="Img3 GImage"><img id="img_1645981756043" alt="img_1645981756043" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Telecharger-le-serveur-MySQL-sous-Windows-Acceder-au-lien-de-telechargement"><a class="Link9" href="#Telecharger-le-serve